// react-router-dom components
import { Link } from "react-router-dom";
import { useEffect, useState } from "react";

// @mui material components
import Switch from "@mui/material/Switch";
import Grid from "@mui/material/Grid";
import AppBar from "@mui/material/AppBar";
import Tabs from "@mui/material/Tabs";
import Tab from "@mui/material/Tab";

// Soft UI Dashboard React components
import SoftBox from "components/SoftBox";
import SoftTypography from "components/SoftTypography";
import SoftInput from "components/SoftInput";
import SoftButton from "components/SoftButton";

// Soft UI Dashboard React base styles
import breakpoints from "assets/theme/base/breakpoints";

// Authentication layout components
import CoverLayout from "layouts/authentication/components/CoverLayout";

// Images
import curved9 from "assets/images/curved-images/curved-6.jpg";

// Soft UI Dashboard React icons
import Cube from "examples/Icons/Cube";
import Document from "examples/Icons/Document";
import Settings from "examples/Icons/Settings";
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";

// Overview page components
import Header from "./../components/Header/index";

function ChallengeCreate() {
  const [rememberMe, setRememberMe] = useState(true);

  const handleSetRememberMe = () => setRememberMe(!rememberMe);

  const [tabsOrientation, setTabsOrientation] = useState("horizontal");
  const [tabValue, setTabValue] = useState(0);

  useEffect(() => {
    // A function that sets the orientation state of the tabs.
    function handleTabsOrientation() {
      return window.innerWidth < breakpoints.values.sm
        ? setTabsOrientation("vertical")
        : setTabsOrientation("horizontal");
    }
    window.addEventListener("resize", handleTabsOrientation);

    handleTabsOrientation();

    return () => window.removeEventListener("resize", handleTabsOrientation);
  }, [tabsOrientation]);

  const handleSetTabValue = (event, newValue) => setTabValue(newValue);

  return (
    <DashboardLayout>
      <Header />
      <CoverLayout
        title="챌린지 만들기"
        description="건전하고 공정한 챌린지로 모두 즐겁게 운동할 수 있게 해주세요."
        image={curved9}
      >
        <SoftBox component="form" role="form">
          <SoftBox mb={2}>
            <SoftBox mb={1} ml={0.5}>
              <SoftTypography component="label" variant="caption" fontWeight="bold">
                챌린지 제목
              </SoftTypography>
            </SoftBox>
            <SoftInput type="title" placeholder="챌린지 제목" />
          </SoftBox>
          <SoftBox mb={2}>
            <SoftBox mb={1} ml={0.5}>
              <SoftTypography component="label" variant="caption" fontWeight="bold">
                챌린지 유형
              </SoftTypography>
            </SoftBox>
            <Grid item xs={12} md={6} lg={4} sx={{ ml: "auto" }}>
              <AppBar position="static">
                <Tabs
                  orientation={tabsOrientation}
                  value={tabValue}
                  onChange={handleSetTabValue}
                  sx={{ background: "transparent" }}
                >
                  <Tab label="체중 감소" icon={<Cube />} />
                  <Tab label="근력 향상" icon={<Document />} />
                  <Tab label="종합 건강 증진" icon={<Settings />} />
                </Tabs>
              </AppBar>
            </Grid>
          </SoftBox>
          <SoftBox mb={2}>
            <SoftBox mb={1} ml={0.5}>
              <SoftTypography component="label" variant="caption" fontWeight="bold">
                인증 빈도
              </SoftTypography>
            </SoftBox>
            <Grid item xs={12} md={6} lg={4} sx={{ ml: "auto" }}>
              <AppBar position="static">
                <Tabs
                  orientation={tabsOrientation}
                  value={tabValue}
                  onChange={handleSetTabValue}
                  sx={{ background: "transparent" }}
                >
                  <Tab label="매일" icon={<Cube />} />
                  <Tab label="평일 매일" icon={<Document />} />
                  <Tab label="주말 매일" icon={<Settings />} />
                  <Tab label="주 1일" icon={<Settings />} />
                  <Tab label="주 2일" icon={<Settings />} />
                  <Tab label="주 3일" icon={<Settings />} />
                </Tabs>
              </AppBar>
            </Grid>
          </SoftBox>

          <SoftBox mb={2}>
            <SoftBox mb={1} ml={0.5}>
              <SoftTypography component="label" variant="caption" fontWeight="bold">
                챌린지 기간
              </SoftTypography>
            </SoftBox>
            <Grid item xs={12} md={6} lg={4} sx={{ ml: "auto" }}>
              <AppBar position="static">
                <Tabs
                  orientation={tabsOrientation}
                  value={tabValue}
                  onChange={handleSetTabValue}
                  sx={{ background: "transparent" }}
                >
                  <Tab label="2주간" icon={<Cube />} />
                  <Tab label="4주간" icon={<Document />} />
                  <Tab label="8주간" icon={<Settings />} />
                </Tabs>
              </AppBar>
            </Grid>
          </SoftBox>
          <SoftBox mb={2}>
            <SoftBox mb={1} ml={0.5}>
              <SoftTypography component="label" variant="caption" fontWeight="bold">
                챌린지 시작일
              </SoftTypography>
            </SoftBox>
            <SoftInput type="title" placeholder="챌린지 제목" />
          </SoftBox>
          <SoftBox mb={2}>
            <SoftBox mb={1} ml={0.5}>
              <SoftTypography component="label" variant="caption" fontWeight="bold">
                인증 방법
              </SoftTypography>
            </SoftBox>
            <SoftInput type="title" placeholder="챌린지 제목" />
          </SoftBox>
          <SoftBox mb={2}>
            <SoftBox mb={1} ml={0.5}>
              <SoftTypography component="label" variant="caption" fontWeight="bold">
                인증샷 예시 (업로드)
              </SoftTypography>
            </SoftBox>
            <SoftInput type="title" placeholder="챌린지 제목" />
          </SoftBox>
          <SoftBox mb={2}>
            <SoftBox mb={1} ml={0.5}>
              <SoftTypography component="label" variant="caption" fontWeight="bold">
                어떻게 인증할까요?
              </SoftTypography>
            </SoftBox>
            <Grid item xs={12} md={6} lg={4} sx={{ ml: "auto" }}>
              <AppBar position="static">
                <Tabs
                  orientation={tabsOrientation}
                  value={tabValue}
                  onChange={handleSetTabValue}
                  sx={{ background: "transparent" }}
                >
                  <Tab label="일일 1번" icon={<Cube />} />
                  <Tab label="일일 2번" icon={<Document />} />
                </Tabs>
              </AppBar>
            </Grid>
          </SoftBox>
          {/* <SoftBox display="flex" alignItems="center">
          <Switch checked={rememberMe} onChange={handleSetRememberMe} />
          <SoftTypography
            variant="button"
            fontWeight="regular"
            onClick={handleSetRememberMe}
            sx={{ cursor: "pointer", userSelect: "none" }}
          >
            &nbsp;&nbsp;Remember me
          </SoftTypography>
        </SoftBox> */}
          <SoftBox mb={2}>
            <SoftBox mb={1} ml={0.5}>
              <SoftTypography component="label" variant="caption" fontWeight="bold">
                챌린지 소개
              </SoftTypography>
            </SoftBox>
            <SoftInput type="title" placeholder="챌린지 제목" />
          </SoftBox>
          <SoftBox mb={2}>
            <SoftBox mb={1} ml={0.5}>
              <SoftTypography component="label" variant="caption" fontWeight="bold">
                예치 포인트
              </SoftTypography>
            </SoftBox>
            <SoftInput type="title" placeholder="챌린지 제목" />
          </SoftBox>
          <SoftBox mt={4} mb={1}>
            <SoftButton variant="gradient" color="info" fullWidth>
              챌린지 만들기
            </SoftButton>
          </SoftBox>
        </SoftBox>
      </CoverLayout>
    </DashboardLayout>
  );
}

export default ChallengeCreate;
